import axios from 'axios';
import {ADD_DIARY} from './types';


export const addDiary = (newDiary) => {
    return (dispatch, getState) => {
        axios
        .post("http://localhost:3001/api/diary/diaries/new", newDiary)
        .then(diaries => {
            dispatch({
                type: ADD_DIARY,
                diaries
            })

        })
        .catch(error => {
            console.log(error.response)
        })
    }
}
